import Contacts from './pages/Contact';
import Menu from './pages/Menu';
import Nav from './Nav'
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Nav />
      <Menu />
      <Contacts />
    </div>
  );
}

export default App;
